import './App.css';
import AudioComponent from './components/AudioCom'
import ReactAudioPlayer from 'react-audio-player';
function App() {
  return (
    <div className="App">
      <header className="App-header">
          <AudioComponent/>
          <ReactAudioPlayer src="./assets/song.mp3" autoPlay controls/>
      </header>

    </div>
  );
}

export default App;
